        tsp.nombre                                                  AS nombreSubProducto,
        CONCAT(tp.nombre,' ',tsp.nombre,' ',tv.nombre)              AS nombreProductoCompleto,
        CONCAT(u.nombre,', ',u.apellido)                            AS cliente,
        u.id                                                        AS idCliente,
        CONCAT(pp.cantidad_bandejas_pedidas,' (x',tb.nombre,')')    AS cantidadBandejas,
